import React, { useState, useEffect } from 'react';
import { Grid, Image, Card, CardContent, CardHeader, CardMeta, CardDescription, Segment, Icon } from 'semantic-ui-react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Teams = () => {
    const [teams, setTeams] = useState([]);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchTeams = async () => {
            try {
                const response = await axios.get('http://localhost:8000/team');
                setTeams(response.data);
            } catch (error) {
                console.error('Error fetching teams:', error);
            }
        };

        fetchTeams();
    }, []);

    const navigateToTeamDetails = (teamId) => {
        navigate(`/team/${teamId}`);
    };

    return (
        <div>
            <Segment color='white' textAlign='center' style={{ padding: '1rem', marginBottom: '1rem' }}>
                <h1>Teams</h1>
            </Segment>
            <div style={{ paddingLeft: "5rem", backgroundColor: "lightgrey" }}>
                <Grid columns={5} container doubling stackable>
                    {teams.map(team => (
                        <Grid.Column key={team._id} style={{ marginBottom: '2rem', marginTop: "2rem" }}>
                            <div className="group overflow-hidden rounded-lg shadow-lg transition duration-300 ease-in-out transform hover:-translate-y-5 hover:shadow-xl cursor-pointer">
                                <Card onClick={() => navigateToTeamDetails(team._id)}>
                                    <Image src={team.avatar} wrapped ui={false} />
                                    <CardContent>
                                        <CardHeader>{team.name}</CardHeader>
                                        <CardMeta>Established in {team.establishedYear}</CardMeta>
                                        <CardDescription>{team.description}</CardDescription>
                                    </CardContent>
                                    <CardContent extra>
                                        <a>
                                            <Icon name='users' />
                                            {team.members.length} Members
                                        </a>
                                    </CardContent>
                                </Card>
                            </div>
                        </Grid.Column>
                    ))}
                </Grid>
            </div>
        </div>
    );
};

export default Teams;
